(20431, '2E41CFE9-FAFA-426F-A3CD-0D91E0ED3ED0', 'Hi love. Wanted to say sorry for having to run off in mid sentence. I️ really appreciate all the work you are doing to look at some habits that don’t serve us well. I️ am your partner in this work and feel equally accountable for doing my part as well. I’ll be more clear when I️ experience judgement and let you know that that’s what’s happening (and refrain from going into lawyer mode). Your work on making our partnership stronger is really special to me. I️ value and appreciate you so so so much for doing it and it’s what makes me love you more every day. Thank you for being raw with me. I️ know it’s hard work. I️ am throwing my arms around you right now and saying how much I️ love love love you.', 'Nitzan', 'David', '2021-01-21T12:08:02.115881'),
