(20940, '911CF5E2-24D0-4E5F-B0A5-814E64788807', 'Love. I️ know the last 48 hours have been really painful for you, and by extension, for me. I️ wish I️ had some great explanation for my behavior and you are right to call me out of being out of integrity with my comittments. You deserve honesty and transparency. You have been nothing short of wonderful these last 5 months as we worked to build 2.0. I️ know I️ just set us back a lot and I’m beyond distraught and sorry for this fresh injection of pain. I️ wish I️ could be better. I️ don’t know why I️ botched this so royally. I️ hope you’ll work with me to get through this terrible bump in our road. I️ love you and us more than anything in the world.', 'Nitzan', 'David', '2021-02-02T11:47:13.968128'),
