(20992, 'C226E2BB-A4DE-4FF3-95A2-173EB5B8994E', 'oops.', 'David', 'Nitzan', '2021-02-03T12:21:16.252000'),
(20993, 'F5ADBE89-4964-44E8-BC4B-8F2D91F7A510', 'Love, I woke up this morning feeling grounded and clear, anxious and profoundly sad. I felt clear that I rather not be in a relationship with you than be in one where I am constantly fearful of another betrayal. The thought of waking up another few years from now and learning again that I was living in one reality with you, but actually was just in the dark, is too much. I rather construct a life on my own and as a co-parent with you.. The sadness comes from the realization that this path, is not out of the question. While it is the last thing in the world that I want, I feel that my confidence has been shaken. As I replay our conversations from the last two days, there are moments when I’ve been really fearful, because I’ve felt unsure whether you will do the inner work to understand “why.” When you say things like, you were being transparent, because I could have looked at your phone at any time, or that you had told me you had sent a photo from your Salesforce shoot, I feel little moments of panic and I feel distant from you. I know we will have more to unpack with Priscilla, but wanted to let you know, if I seem kinda down today...you know why. I feel both clear, and very sad. The thought of not spending the rest of my days with you breaks my heart. But....it’s very fragile...I didn’t realize how fragile.', 'David', 'Nitzan', '2021-02-03T12:21:35.453000'),
(20994, 'F5874E1C-0C84-4541-8C98-6C28C46ADE6F', 'Thank you love for sharing these thoughts in a really constructive way. As I️ sit at my computer with tears streaming down my face, I️ want you to know that I️ love your fragile heart to death. I️’m devastated that I️ have broken your heart and have shaken your confidence in us. I️ have a lot of self loathing right now as this is literally the last thing in the world I️ have wanted for you or us. And I️ care so deeply about your fragile and beautiful heart. I’m equally and deeply sad. I️ promise I️ will do my work to understand the why. I didn’t leave my therapist because I️ didn’t want to to that work -- I️ left because I️ wasn’t getting there with her. I’m ready to work with someone new. I’m also hopeful that we can work with Priscilla on all of this and work through the fragility. I️ really appreciate that you are coming to me with compassion AND clarity. I️ really screwed up. I️ know that. I’m grateful that you are open to working on us and for giving us another chance. I️ will do my internal part as well. Please don’t give up on us. We are too good and have come so so far to let it go. And I️ will fight for us. Please don’t lose hope.', 'Nitzan', 'David', '2021-02-03T12:46:46.772268'),
